/** @format */

import React from "react";
import { TitleBlock, Thumbnail, TitleBox } from "./StyleTitleCard";
const TitleCard = () => {
  return (
    <>
      <TitleBlock>
        <Thumbnail />
        <TitleBox />
      </TitleBlock>
    </>
  );
};

export default TitleCard;
